import {Form,Main,Input,Button,Col,Label,TextArea} from './style'
const DiscussForm=()=>{
    return( 
         <Main><Form>
             <Col><span style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></span>
             <span style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></span>
  </Col><Col><span style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></span>
  <div style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></div></Col>
        <Col><Label for="html">HTML</Label><TextArea/></Col>
        </Form>
        <Button>GET A QUATE</Button></Main>
        )
}
export default DiscussForm;
